      :
      props.todotransfer.map((todo_map) => {
      return (
      <TodoItem todo = {todo_map} onDelete = {props.ondel}/>
      )
      })}
      {/* <TodoItem todo = {props.todotransfer[1]}/> */}
  </div>
};
